		public GameObject NinjaPrefab;

		Generator generator;

		GameObject camera;
		GameObject layer;
		GameObject ground;

		public float player1Lives;
		public float player2Lives;

		void Awake() {
			camera = GameObject.Find("/Camera");
			layer = GameObject.Find("/Layer");
			ground = GameObject.Find("/Layer/Background");
			generator = GetComponent<Generator>();
			SetupMapChip(mapchipBackground, ground);
			SetupMapChip(mapchipBlocks, layer);
			SetupMapChip(mapchipGameObject, layer);
			InvokeRepeating("SendInNinja", 2f, 2f);
		}

		void Start() {
		}

		void Update() {
			if (!ExistKoban()) {
				AreaClear ();
			}
			if (!ExistNinja()) {
				SendInNinja();
			}
		}

		public float GetPlayerLives(int playerId) {
			float lives = 0f;
			switch(playerId) {
			case 1:
				lives = player1Lives;
				break;
			case 2:
				lives = player1Lives;
				break;
			}
			return lives;
		}

		public float GetPlayer2Lives() {
			return player2Lives;
		}

		void SetupMapChip(int[][] mapchip, GameObject parent) {
			var layerTransform = layer.GetComponent<RectTransform>();
			float viewWidth = layerTransform.rect.width;
			float viewHeight = layerTransform.rect.height;
			float chipWidth = 8f;
			float chipHeight = 8f;
			int y = 0;
			int x = 0;
			for(y = 0 ; y < mapchip.Length; ++y) {
				for(x = 0; x < mapchip[y].Length; ++x) {
					var chipId = mapchip[y][x];
					if (chipId != 0) {
						var prefab = generator.GenerateById(chipId);
						if (prefab != null) {
							var position = new Vector3(- viewWidth/2 + chipWidth/2 + chipWidth * (x),
							                           viewHeight/2 - chipHeight/2 - chipHeight * (y));
							var chip = (GameObject)Instantiate(prefab, Vector3.zero, Quaternion.identity);
							chip.transform.parent = parent.transform;
							chip.transform.position = position;
						}
					}
				}
			}
		}

		void ResetGame() {
			Application.LoadLevel("GameMain");
		}

		public float GetScore() {
			return score;
		}

		public void AddScoreByHealth(Health health) {
			AddScore (health.score);
		}

		void AddScore(float v) {
			score += v;
			if (score > topScore) {
				topScore = score;
			}
		}

		public float GetKoban() {
			return koban;
		}

		void TakeKoban() {
			koban++;
		}

		bool ExistKoban() {
			var objs = GameObject.FindGameObjectsWithTag("Koban");
			if (objs .Length > 0) {
				return true;
			}
			return false;
		}

		bool ExistNinja() {
 			var objs = GameObject.FindGameObjectsWithTag("Ninja");
			if (objs .Length > 0) {
				return true;
			}
			return false;
		}

		void AreaClear() {
			ResetGame();
		}

		void SendInNinja() {
			var cp = camera.transform.position;
			var ninja = (GameObject)Instantiate(NinjaPrefab, Vector3.zero, Quaternion.identity);
			ninja.transform.parent = layer.transform;
		}
    }
